import React from 'react'

export default function Subscription({subscription}) {
    return (
        <div>
            <li className="bg-white flex items-center shadow-lg rounded-lg my-2 py-2 px-4 ">
                <input type="checkbox" name="marked" id="marked" checked={subscription.fields.archive} className="mr-2 form-checkbox h-5 w-5"/>
                <p className={`flex-1 text-gray-800 ${subscription.fields.archive?'underline':''} line-through`} >{subscription.fields.name}</p>

            </li>
           


            
        </div>
    )
}
